// HasOrderSnap applies the HasEdge predicate on the "order_snap" edge.
func HasOrderSnap() predicate.Order {
	return predicate.Order(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.To(OrderSnapTable, FieldID),
			sqlgraph.Edge(sqlgraph.O2M, false, OrderSnapTable, OrderSnapColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasOrderSnapWith applies the HasEdge predicate on the "order_snap" edge with a given conditions (other predicates).
func HasOrderSnapWith(preds ...predicate.OrderSnap) predicate.Order {
	return predicate.Order(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.To(OrderSnapInverseTable, FieldID),
			sqlgraph.Edge(sqlgraph.O2M, false, OrderSnapTable, OrderSnapColumn),
		)
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

